function addItem() {
    let unitsContainer = document.getElementById("unitsContainer");
    let div = document.createElement("div");
    div.classList.add("unit");
    div.innerHTML = `
        <input type="text" class="description" placeholder="Item Description" required>
        <input type="number" class="quantity" placeholder="Quantity" required>
        <input type="number" class="nights" placeholder="Number of Nights">
        <input type="number" class="rate" placeholder="Rate (Rs)" required>
        <button type="button" class="removeItem" onclick="removeItem(this)">X</button>
    `;
    unitsContainer.appendChild(div);
}

function removeItem(button) {
    button.parentElement.remove();
}

// Format Date (e.g., "07 Feb 2025")
function formatDate(dateString) {
    let date = new Date(dateString);
    return date.toLocaleDateString("en-GB", { day: "2-digit", month: "short", year: "numeric" });
}

async function generateInvoice() {
    const { jsPDF } = window.jspdf;
    let doc = new jsPDF();

    if (!doc.autoTable) {
        console.error("Error: autoTable plugin is missing!");
        return;
    }

    // Add Logo (Replace with your actual Base64 logo)
    const logoBase64 = "data:image/png;base64, "; // Replace with your Base64 image
    doc.addImage(logoBase64, "PNG", 5, 6, 200, 43); // Adjust position & size

    // Invoice Title
    doc.setFillColor(11, 218, 222);
	doc.rect(10, 46, 107, 20, "F");
    doc.setFont("helvetica", "bold");
    doc.setFontSize(16);
    doc.setTextColor(255, 255, 255);
    doc.text("MAWA  HOTEL BOOKING INVOICE", 15, 55);
	
	// Invoice Title
    doc.setFontSize(12);
    doc.setTextColor(255, 255, 255);
    doc.text(" +92 347 9004293", 15, 60);

    // Customer Description Title
    doc.setFontSize(10);
    doc.setTextColor(255, 255, 255);
    doc.text("Customer Details", 120, 41);
	doc.line(120, 73, 180, 73);
     
	 // Customer Details
	doc.setFont("times", "normal");
    doc.setFontSize(14);
    doc.setTextColor(0, 0, 0); // Black
    
	// Get booking number safely
    let bookingNumber = document.getElementById("bookingNumber").value;
    let name = document.getElementById("name").value;
    let phoneNumber = document.getElementById("phoneNumber").value;
    let idCard = document.getElementById("idCard").value;
    let checkInDate = formatDate(document.getElementById("checkInDate").value);
    let checkOutDate = formatDate(document.getElementById("checkOutDate").value);
    let roomType = document.getElementById("roomType").value;
    let roomsNumber = document.getElementById("roomsNumber").value;
    let advance = parseFloat(document.getElementById("advance").value) || 0;
	let gstPercent=parseFloat(document.getElementById("gstPercent").value)||0;

    let units = [];
    let subtotal = 0;
	sr = 1;

    document.querySelectorAll(".unit").forEach((unit) => {
        let description = unit.querySelector(".description").value;
        let quantity = parseInt(unit.querySelector(".quantity").value) || 0;
        let nights = parseInt(unit.querySelector(".nights").value) || 0;
        let rate = parseFloat(unit.querySelector(".rate").value) || 0;

        let total = nights > 0 ? quantity * nights * rate : quantity * rate;
        subtotal += total;

        units.push([sr++,description, quantity, nights, rate.toFixed(2), total.toFixed(2)]);
    });

    if (units.length === 0) {
        alert("Please add at least one unit.");
        return;
    }

    let gst=subtotal*gstPercent/100; // 10% GST
    let grandTotal = subtotal + gst;
    let balanceAmount = grandTotal - advance;

    // Booking Details
    doc.setFontSize(12);
    doc.setTextColor(0, 0, 0);
    doc.text(`Booking Number: ${bookingNumber}`, 125, 50);
    doc.text(`Guest Name: ${name}`, 125, 57);
    doc.text(`Phone Number: ${phoneNumber}`, 125, 64);
    doc.text(`ID Card Number: ${idCard}`, 125, 71);
    doc.text(`Check-In Date: ${checkInDate}`, 20, 80);
    doc.text(`Check-Out Date: ${checkOutDate}`, 110, 80);
    doc.text(`Room Type: ${roomType}`, 20, 88);
    doc.text(`Rooms Number: ${roomsNumber || "N/A"}`, 110, 88);

    // Invoice Table with Colored Borders
    doc.autoTable({
        startY: 95,
        head: [["Sr","Description", "Qty", "Nights", "Rate (Rs)", "Total (Rs)"]],
        body: units,
        columnStyles: {
            0: { cellWidth: 10 }, // sr no
			1: { cellWidth: 90 }, // Description
            2: { cellWidth: 10, halign: "center" }, // Quantity (Smaller)
            3: { cellWidth: 15, halign: "center" }, // Nights (Smaller)
            4: { cellWidth: 27, halign: "right" }, // Rate
            5: { cellWidth: 35, halign: "right" }, // Total
        },
        styles: {
            lineColor: [0, 102, 204],
            lineWidth: 0.5,
            textColor: [0, 0, 0],
            fontStyle: "bold",
        },
        headStyles: {
            fillColor: [0, 51, 153],
            textColor: [255, 255, 255],
            fontStyle: "bold",
        },
        alternateRowStyles: {
            fillColor: [240, 240, 240],
        },
    });

    // Subtotal, GST & Grand Total
 const finalY = doc.lastAutoTable.finalY + 1;
doc.autoTable({
  startY: finalY,   //  IMPORTANT
  margin: { left: 128 },

  body: [
    ["Subtotal", "Rs " + subtotal.toFixed(2)],
    ["Bed Tax " + gstPercent + "%", "Rs " + gst.toFixed(2)],
    ["Grand Total", "Rs " + grandTotal.toFixed(2)],
    ["Advance Paid", "Rs " + advance.toFixed(2)],
    ["Balance Due", "Rs " + balanceAmount.toFixed(2)]
  ],

  theme: "grid",

  styles: {
    fontSize: 11,
    fontStyle: "bold",
    cellPadding: 3,
    textColor: [0, 0, 0],
    fillColor: [250, 250, 250],
    lineWidth: 0.3
  },

  columnStyles: {
    0: { cellWidth: 38 },
    1: { cellWidth: 35, halign: "right" }
  },

  didParseCell: function (data) {
    // Highlight Balance row
    if (data.row.index === 4) {
      data.cell.styles.fillColor = [220, 245, 230];
      data.cell.styles.textColor = [0, 100, 0];
      data.cell.styles.fontSize = 12;
    }

    // Make Grand Total slightly darker
    if (data.row.index === 2) {
      data.cell.styles.fillColor = [230, 230, 255];
    }
  }
});
    // Footer - Thank You Message
    let footerY = finalY + 60;
    doc.setFont("times", "italic");
    doc.setFontSize(14);
    doc.setTextColor(34, 139, 34);
	doc.setLineDash([3, 3]); // Dashed line (3px dash, 3px gap)
    doc.line(20, finalY + 55, 200, finalY + 55);
    doc.setLineDash([]); // Reset to solid lines
    doc.text("Thank you for choosing MAWA  HOTEL & RESTAURANT!", 20, footerY);
    doc.setFontSize(16);
    doc.setTextColor(11, 218, 222);
    doc.text("We Believe in Relationship.", 20, footerY + 10);
    doc.setFontSize(14);
	doc.setTextColor(204, 0, 0);
    doc.text("See the second page attached to read the general terms and conditions.", 20, footerY + 20);
  
 const pageCount = doc.getNumberOfPages();

for (let i = 1; i <= pageCount; i++) {
  doc.setPage(i);

  const pageWidth = doc.internal.pageSize.getWidth();
  const pageHeight = doc.internal.pageSize.getHeight();

  doc.setFillColor(11, 218, 222);
  doc.rect(10, pageHeight - 12, pageWidth - 20, 9, "F");

  doc.setTextColor(255, 255, 255);
  doc.setFontSize(11);
  doc.setFont("helvetica", "bold");
  doc.text(
    "MAWA HOTEL & RESTAURANT | Phone: +92 347 9004293",
    pageWidth / 2,
    pageHeight - 6,
    { align: "center" }
  );
}
    // Generate and Download/Share PDF
    let pdfBlob = doc.output("blob");
    let file = new File([pdfBlob], "Mawa_Hotel_booking_invoice.pdf", { type: "application/pdf" });

    if (navigator.share) {
        try {
            await navigator.share({
                title: "Mawa  Hotel Booking Invoice",
                text: "Booking Invoice for " + name,
                files: [file],
            });
            alert("Invoice shared successfully!");
        } catch (error) {
            console.error("Error sharing invoice:", error);
            downloadPDF(pdfBlob);
        }
    } else {
        downloadPDF(pdfBlob);
    }
}

function downloadPDF(pdfBlob) {
    let pdfURL = URL.createObjectURL(pdfBlob);
    let link = document.createElement("a");
    link.href = pdfURL;
    link.download = "Mawa_Hotel_booking_invoice.pdf";
    document.body.appendChild(link);
    link.click();
    document.body.removeChild(link);
}
